import React from 'react';
import {logo} from '.././assets/logos/shutterstock-logo.jpg'

function BottomNav() {
    return (
        <div className="nav">
            <div className="nav">
                <img src= {logo} alt = "logo" className='nav__logo'></img>
                <button className="nav__action-button"><h4 className="nav__action-button-text">TAG</h4></button>
                <button className="nav__action-button"><h4 className="nav__action-button-text">TAG</h4></button>
                <button className="nav__action-button"><h4 className="nav__action-button-text">TAG</h4></button>
            </div>
        </div>
    )
}

export default BottomNav
